import React from 'react'
import products from '../products'
import { Row, Col } from 'react-bootstrap'

const Shop = () => {
  return (
    <>
      <h1>Products List</h1>
      <Row>
        {products.map((product) => (
          <Col sm={12} md={6} lg={4}xl>
            <h3>{product.name}</h3>
          </Col>
        ))}
      </Row>
    </>
  )
}

export default Shop
